import React, { Component } from "react";
import "../styles/About.css";
import banner from "../tree.png";

export default class Contact extends Component {
  render() {
    return (
      <div>
        <div className="about_title">
          <h1 className="about_title_text">About Me</h1>
          <h2 className="about_title_subtext1">
            Currently, I am a senior majoring in Information Science and English
            at Cornell University's College of Arts &amp; Sciences.
          </h2>
          <h2 className="about_title_subtext1">
            They are a mix of website designs and individual programming
            projects.
          </h2>
          <h2 className="about_title_subtext">
            Click on the white arrows and scroll down on the gray monitors to
            see examples.
          </h2>
        </div>
      </div>
    );
  }
}
